import React from 'react'
import PropTypes from 'prop-types';

const Paragraph = ({heading , paragraph}) => {
  return (
    <div className='content'>
        <h1 className='heading'>{heading}</h1>
        <p className='paragraph'>{paragraph}</p>
    </div>
  )
};



export default Paragraph;
